  false,\n\t\"url\": null,\n\t\"notes\": \"The Apalachicola Bay National Estuarine
  Research Reserve and the NOAA Office for Coastal Management worked together to map
  benthic habitats within Apalachicola Bay, Florida. The bay and the lower portions
  of four distributaries were surveyed on 11-22 October 1999 using three benthic sampling
  techniques. This data set represents the information gathered from sediment profile
  imagery sampling. Images were collected at 436 stations throughout the bay.\",\n\t\"license_title\":
